El arquetipo del hongo, motas blancas y rojos metálicos apetecibles y atractivos, sinónimo de buenas condiciones en el ecosistema. Éste hongo tan misterioso como popular, alucinógeno, atrae a las moscas con colores y componentes tóxicos con las que acaba con el sistema nervioso de sus presas.
Presente en casi todos los rincones del planeta, prefiere las condiciones frías y su origen se asocia a Siberia.
En el ser humano, su ingesta puede ocasionar desmayo, sensación de borrachera, depresión neurológica, vómito, ataques de furia, entre otros.
La seta del cuento maravilloso, prefiere sólo eclosionar bajo ciertos árboles, en la altura, en el frío.
